PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `knex_migrations` (`id` integer not null primary key autoincrement, `name` varchar(255), `batch` integer, `migration_time` datetime);
CREATE TABLE `knex_migrations_lock` (`index` integer not null primary key autoincrement, `is_locked` integer);
CREATE TABLE `consoles` (`id` varchar(255), `name` varchar(255) not null, `type` varchar(255) not null, `status` varchar(255) not null default 'available', `hourly_rate` float not null, `created_at` datetime not null default CURRENT_TIMESTAMP, `updated_at` datetime not null default CURRENT_TIMESTAMP, hourly_rate_2v2 DECIMAL(8,2) DEFAULT 0.00, `current_mode` text check (`current_mode` in ('1vs1', '2vs2')) not null default '1vs1', `mode_hourly_rates` json not null default '{"1vs1":10,"2vs2":15}', primary key (`id`));
CREATE TABLE `sessions` (`id` varchar(255), `console_id` varchar(255), `start_time` datetime not null, `end_time` datetime, `status` varchar(255) not null default 'active', `total_paused_duration` integer default '0', `final_cost` float, `created_at` datetime not null default CURRENT_TIMESTAMP, `updated_at` datetime not null default CURRENT_TIMESTAMP, `paused_at` datetime null, `paused_duration` integer default '0', gaming_mode VARCHAR(10) DEFAULT '1v1', foreign key(`console_id`) references `consoles`(`id`) on delete SET NULL, primary key (`id`));
CREATE TABLE `session_items` (`id` integer not null primary key autoincrement, `session_id` varchar(255), `product_id` varchar(255), `quantity` integer not null, `unit_price` float not null, `subtotal` float not null, `created_at` datetime not null default CURRENT_TIMESTAMP, `updated_at` datetime not null default CURRENT_TIMESTAMP, foreign key(`session_id`) references `sessions`(`id`) on delete CASCADE, foreign key(`product_id`) references `products`(`id`) on delete SET NULL);
CREATE TABLE `products` (`id` varchar(255), `name` varchar(255) not null, `category` varchar(255) not null, `price` float not null, `cost` float not null, `stock` integer not null default '0', `low_stock_threshold` integer not null default '10', `barcode` varchar(255), `created_at` datetime not null default CURRENT_TIMESTAMP, `updated_at` datetime not null default CURRENT_TIMESTAMP, `description` text null, primary key (`id`));
CREATE TABLE `users` (`id` integer not null primary key autoincrement, `username` varchar(255) not null, `password_hash` varchar(255) not null, `created_at` datetime not null default CURRENT_TIMESTAMP, `updated_at` datetime not null default CURRENT_TIMESTAMP);
CREATE TABLE `receipts` (`id` varchar(255), `subtotal` float not null, `tax` float not null, `total` float not null, `payment_method` varchar(255) not null, `session_id` varchar(255) null, `created_at` datetime not null default CURRENT_TIMESTAMP, `updated_at` datetime not null default CURRENT_TIMESTAMP, `manual_console_price` float null, `calculated_console_price` float null, gaming_mode VARCHAR(10) DEFAULT '1v1', `base_hourly_rate` float null, `hourly_rate_2v2` float null, foreign key(`session_id`) references `sessions`(`id`) on delete SET NULL, primary key (`id`));
CREATE TABLE `receipt_items` (`id` integer not null primary key autoincrement, `receipt_id` varchar(255), `product_id` varchar(255), `quantity` integer not null, `unit_price` float not null, `subtotal` float not null, `product_name` varchar(255) null, foreign key(`receipt_id`) references `receipts`(`id`) on delete CASCADE, foreign key(`product_id`) references `products`(`id`) on delete SET NULL);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX `products_barcode_unique` on `products` (`barcode`);
CREATE UNIQUE INDEX `users_username_unique` on `users` (`username`);
COMMIT;
